import React, { useCallback } from "react";
import axios from "axios";

const Main = () => {
	const [users, setUsers] = useState(false);
  const onClickUser = useCallback(() => {
    axios({
      method: "GET",
      url: "https://jsonplaceholder.typicode.com/users",
      responseType: "stream",
    }).then(res => {
      console.log(res.data);
    });
  }, []);

  onClickUser();
  return <div></div>;
};

export default Main;
